import { useNavigate } from "react-router-dom"

export let withLoginNavigate = (Component) =>
{
    let compWithLoginNavigate = (props) =>
    { 
    const navigate = useNavigate()
        if(props.isAuth)
        {
        return(
           <Component />
        )
        }
        else{
         navigate('/Login')
        }
    }


   return compWithLoginNavigate
}
